  <tbody>
    {patients.map((patient) => (
      <tr key={patient.id}>
        <td>{patient.name}</td>
        <td>{patient.age}</td>
        <td>{patient.condition}</td>
      </tr>
    ))}
  </tbody>
 
          
        ))}
</table>
      </ul>
    </div>
  );
};

export default PatientList;
